import _ from "lodash";
import { useState } from "react";
import { FetchWithId, getUrlId } from "../func";
import Article from "./Article";

function ArticleSearchList({user}) {
    const searchParam = getUrlId(1);
    const [searchResults, setSearchResult] = useState({data : {}});
    console.log(searchParam);
    if(_.isEmpty(searchParam)){
        window.location.replace('/board');
    }else{
        setSearchResult(Array.from(FetchWithId("board/search", searchParam)));
    }
    console.log(searchResults);

    if(_.isEmpty(searchResults)){ return <div> Loading ... </div> }
    else {
        return (
            <div className='div-box'>
                <b style={{ fontSize: "30px"}}> Keyword : {searchParam} </b>
                <ArticleList user={user} articleList={searchResults} />
            </div>
        )
    }
}

export default ArticleSearchList;
